        self.prev = None
        self.next = None

class DoublyLinkedList:

    def __init__(self):
        self.head = None
        self.tail = None

    def add(self, value):
        node = Node(value)
        if self.head is None:
            self.head = node
            self.tail = node
        else:
            node.prev = self.tail
            self.tail.next = node
            self.tail = node

    def remove_last(self):
        if self.tail is None:
            return None
        value = self.tail.value
        if self.head == self.tail:
            self.head = None
            self.tail = None
        else:
            self.tail = self.tail.prev
            self.tail.next = None
        return value

    def is_empty(self):
        return self.head is None

def is_prime(num):
    if num <= 2:
        return False
    for i in range(2, int(num ** 0.5) + 1):
        if num % i == 0:
            return False
    return True

def find_prime_numbers(start, end):
    primes = DoublyLinkedList()
    for i in range(start, end + 1):
        if is_prime(i):
            primes.add(i)
    if primes.is_empty():
        return 'No prime numbers found within the given range.'
    else:
        output = []
        while not primes.is_empty():
            output.append(primes.remove_last())
        return output

